import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { fetchUsers } from "./userSlice";

const UserView = () => {
    const dispatch = useDispatch()
    useEffect(()=>{
        useDispatch(fetchUsers())
        },[])
    return ( 
        <div>
            <h2>List of Users - </h2>
        </div>
     );
}
 
export default UserView;
